import './palette.css';
import Slider from 'rc-slider';
import 'rc-slider/assets/index.css';


function NavBar(props){
    return (
        <header className="Navbar">
            <div className="logo">
                <a href="#">React</a>
            </div>
            <Slider defaultValue={props.lev} min={100} max={900} step={100} onAfterChange={props.ChangeColor}/>
        </header>
    )
}

export default NavBar;
